import React, { Component } from 'react';
import styled from 'styled-components'
import AppBody from '../AppBody'
import Column, { AutoColumn } from '../../components/Column'
import {RowBetween} from "../../components/Row";

const BodyWrapper = styled(AutoColumn)`
  // padding-left: 20px;
  // padding-right: 20px;
`;
const HeadContainer = styled(RowBetween)`
  margin-top: 50px;
  padding: 0 20px;
`;

const SearchContainer = styled.div`
  display: grid;
  grid-template-columns: auto 50px;

  margin: 10px 0px;
  background: #FAFAFA;
  border-radius: 36px;
`;

const SearchInput = styled.input`
  margin: 5px 0px 5px 10px;
  outline: none;
  overflow: hidden;
  text-overflow: ellipsis;
  font-size: 16px;
  background: transparent;
  border-radius: 52px;
  border: 4px solid #FF7D30;

  ::placeholder {
    color: rgba(65, 72, 93, 0.5);
  }
`;

export default class SearchComponent extends Component<any, any> {
    goBack = () => {
        this.props.history.goBack();
    }

    render() {
        return (
            <AppBody>
                <HeadContainer>
                    <SearchContainer>
                      <SearchInput placeholder='Search for Dapps' autoFocus />
                    </SearchContainer>
                    <div onClick={this.goBack}>cancel</div>
                </HeadContainer>
            </AppBody>
        );
    }
}
